description:
TypeScript definitions can now be built ("npm run buildts") and tested ("npm run testts").

Builds on the work in https://github.com/greggman/twgl.js/pull/97 and https://github.com/greggman/twgl.js/pull/98

@greggman Do you have strong feelings about the Vec3 and Mat4 types being in the global scope (`twgl.Vec3` / `twgl.Mat4`) vs. in module scopes (`twgl.v3.Vec3` / `twgl.m4.Mat4`)? The latter module scope option would more closely line up with exactly what the docs say, but I used the former global scope option because I thought that it would be most dev's preference. (Certainly my own.) I'd be fine changing it to the other if you'd rather they be in module scope.

